BEGIN TRANSACTION;
DROP TABLE IF EXISTS "users";
CREATE TABLE "users" ("username" VARCHAR PRIMARY KEY  NOT NULL ,"password" VARCHAR NOT NULL ,"inbox" VARCHAR NOT NULL ,"sent" VARCHAR NOT NULL ,"draft" VARCHAR NOT NULL ,"question" VARCHAR NOT NULL ,"answer" VARCHAR NOT NULL ,"registereddate" VARCHAR,"cell" varchar DEFAULT (null) ,"email" VARCHAR,"dateofbirth" VARCHAR,"position" VARCHAR,"level" VRACHAR,"department" VARCHAR NOT NULL ,"id" INTEGER DEFAULT (null) , "status" VARCHAR NOT NULL  DEFAULT active, "Grade" INTEGER DEFAULT 0, "financialPendings" DOUBLE);
COMMIT;
